import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import logoLambentData from "../icons/logoLambentData.jpeg";
import SettingsIcon from "@material-ui/icons/Settings";
import BottomNavigationAction from "@material-ui/core/BottomNavigationAction";
import HelpOutlineIcon from "@material-ui/icons/HelpOutline";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
}));

export default function TopNavIntro() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={8}>
          <Paper className={classes.paper}>
            <img className="lambent-sizing" src={logoLambentData} alt="Logo" />
          </Paper>
        </Grid>

        <Grid item xs={2}>
          <SettingsIcon style={{ fontSize: 40 }} />
        </Grid>
        <Grid item xs={2}>
          <HelpOutlineIcon style={{ fontSize: 40 }} />
        </Grid>
      </Grid>
    </div>
  );
}
